import React, { useState } from 'react';
import axios from 'axios';
function AddData() {
  const [dataList, setDataList] = useState([]);
  const [input1, setInput1] = useState('');
  const [input2, setInput2] = useState('');
  const [input3, setInput3] = useState('');
  const [input4, setInput4] = useState('');
  const [input5, setInput5] = useState('');
  const [error, setError] = useState('');

  const handleAddData = () => {
    const newData = [input1, input2, input3, input4, input5].filter(item => item.trim() !== '');
    if (newData.length > 0 && newData.length <= 5) {
      setDataList([...dataList, ...newData]);
      setInput1('');
      setInput2('');
      setInput3('');
      setInput4('');
      setInput5('');
      setError('');
    } else if (newData.length === 0) {
      setError('Please enter some data.');
    } else {
      setError('You can only add up to 5 data.');
    }
  };

  return (
    <div>
      <h2>Add Data</h2>
      <input type="text" value={input1} onChange={(e) => setInput1(e.target.value)} />
      <input type="text" value={input2} onChange={(e) => setInput2(e.target.value)} />
      <input type="text" value={input3} onChange={(e) => setInput3(e.target.value)} />
      <input type="text" value={input4} onChange={(e) => setInput4(e.target.value)} />
      <input type="text" value={input5} onChange={(e) => setInput5(e.target.value)} />
      <button onClick={handleAddData}>Add</button>
      {error && <p>{error}</p>}
      <ul>
        {dataList.map((data, index) => (
          <li key={index}>{data}</li>
        ))}
      </ul>
    </div>
  );
}

export default AddData;
